import React from "react";
import styled from "styled-components";
import { Icon } from "./svg/Icon";
import { useSelector } from "react-redux";

const MenuConteiner = styled.div`
  font-family: "TTFirsNeue400";
  margin: 47px auto 0;
  margin-bottom: -56px;
  width: 648px;
  height: 17px;
  display: flex;
  justify-content: space-between;
  @media (max-width: 768px) {
    display: none;
  }
`;

const LeftMenuArrow = styled.div`
  font-size: 14px;
  align-items: center;
  display: flex;
  cursor: pointer;
`;

const RightMenuArrow = styled.div`
  font-size: 14px;
  align-items: center;
  display: flex;
  cursor: pointer;
`;

export default function HeaderMenu({ setActivePage }) {
  const activePage = useSelector((state) => state.activePage.activePage);
  return (
    <div>
      <MenuConteiner>
        <span onClick={() => setActivePage(false)}>
          <Icon id="headerArrow" className="arrow-icon" /> о сотруднике
        </span>
        <span onClick={() => setActivePage(true)}>
          о компании
          <Icon id="headerArrow" className="arrow-icon right" />
        </span>
      </MenuConteiner>
    </div>
  );
}
